import React from 'react';
import './style.css';
import Search from './Search'

class SignUp extends React.Component {
  render() {
    return (
      <div className="signUp">
        <span className="">Agregar {this.props.start}</span>
        <Search/>
      </div>
    );
  }
}

export default SignUp;
